/**
 * Get events filtered by gender
 */
export function getEventsByGender(gender: "gutter" | "jenter"): EventDef[] {
  return Object.values(EVENTS).filter((e) => e.gender === gender);
}

/**
 * Get all unique event display names (without gender prefix)
 */
export function getUniqueEventNames(): string[] {
  const names = new Set<string>();
  Object.values(EVENTS).forEach((e) => names.add(e.displayName));
  return Array.from(names).sort();
}
